import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import { AuthContext } from './AuthContext';
import './Navbar.css';

const Navbar = () => {
  const { isAuthenticated, logout, toggleAuth } = useContext(AuthContext);

  return (
    <nav className="navbar">
      <div className="navbar-left">
        <Link to="/">Home</Link>
        {isAuthenticated && (
          <>
            <Link to="/history" className="navbar-button">History</Link>
            <Link to="/health-info" className="navbar-button">Info</Link> {/* 추가된 Info 버튼 */}
          </>
        )}
      </div>
      <div className="navbar-right">
        {isAuthenticated ? (
          <>
            <span className="navbar-user">홍길동</span>
            <button onClick={logout} className="navbar-button">로그아웃</button>
          </>
        ) : (
          <>
            <Link to="/login" className="navbar-button">로그인</Link>
            <Link to="/signup" className="navbar-button">회원가입</Link>
          </>
        )}
        {/* 임시 토글 버튼 */}
        <button onClick={toggleAuth} className="navbar-button">Toggle Auth</button>
      </div>
    </nav>
  );
};

export default Navbar;
